        <span></span>
        <span></span>
        <span></span>
      </div>

      <ul className={`nav-links ${isActive ? 'active' : ''}`}>
        <li><a href="#github.com/Byemmanuel" onClick={() => setIsActive(false)}>GitHub</a></li>
        <li><a href="#about" onClick={() => setIsActive(false)}>Sobre MÃ­</a></li>
