        <li><a href="#blog" onClick={() => setIsActive(false)}>Blog Personal</a></li>
        <li><a href="#contact" onClick={() => setIsActive(false)}>Contacto</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
